import { Link } from "react-router-dom";


const StyledNavbar=styled.nav`
 margin:0;
height:64px;
color: black ;
background: #022541;
display : flex;
flex-direction: row;
align-items: center;
justify-content:space-between;
@media (max-width: 768px) {
    flex-direction: column;
  }
  `;

const StyledList=styled.div`
display:flex;

justify-content: space-between;

`;


export const Navbar=(probs)=>{

    return(
 <StyledNavbar>
<StyledList>
<Link>Home</Link>
